import { BrowserRouter as Router } from "react-router-dom";
import Route from "react-router-dom/Route";
import React from "react";
import Home from "./index";
import SignInSide from "./registeration/Login";

const Roouter = () => {
  return (
    <Router>
      <div>
        <Route
          path="/"
          exact
          render={() => {
            return (
              <div>
                {/* <Homecontent /> */}
                <Home />
              </div>
            );
          }}
        />
        <Route
          path="/about"
          exact
          render={() => {
            return (
              <div>
                <h1>my name is rishabh </h1>
              </div>
            );
          }}
        />

        <Route
          path="/login"
          exact
          render={() => {
            return (
              <div>
                <SignInSide />
              </div>
            );
          }}
        />
      </div>
    </Router>
  );
};

export default Roouter;
